import React, {Component} from 'react';

class PersonalInfo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      text: 1,
    }
  }

  render() {
    return (
      <div>
        <img src={window.location.origin + `/img/photos/photo_2018-12-20_16-23-55`}></img>

      </div>
   )
  }

}

export default PersonalInfo;
